import React from 'react'
import './Banner.css'
function Banner() {
    return (
        <div className='banner'>
          <div className='banner_info'>
              <h1>Explore the world!</h1>
              <h5>The world is waiting for you to be enlightened</h5>
              </div>  
        </div>
    )
}

export default Banner
